"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Enanthem in coxsackievirus infection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 388px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Scattered petechiae appear centrally, and there is a vesicle posteriorly at the junction of the hard and soft palates. Coxsackievirus produces lesions toward the posterior of the oropharynx, whereas herpes simplex virus appears anteriorly.",
"    <div class=\"footnotes\">",
"    </div>",
