"     4 mg (100): $587.50",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F130949\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     FEV",
"     <sub>",
"      1",
"     </sub>",
"     , peak flow, and/or other pulmonary function tests; blood pressure, heart rate; CNS stimulation; serum glucose, serum potassium; asthma symptoms; arterial or capillary blood gases (if patients condition warrants)",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F130963\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Aero-Vent (PH);",
"     </li>",
"     <li>",
"      Aerolin (BR, CN, GR);",
