"   <div class=\"block pha drugH1Div\" id=\"F130938\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Relaxes bronchial smooth muscle by action on beta",
"     <sub>",
"      2",
"     </sub>",
"     -receptors with little effect on heart rate",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F130957\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Peak effect:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Nebulization/oral inhalation: 0.5-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     CFC-propelled albuterol: 10 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Ventolin&reg; HFA: 25 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Oral: 2-3 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Nebulization/oral inhalation: 3-4 hours; Oral: 4-6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic to an inactive sulfate",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Inhalation: 3.8 hours; Oral: 3.7-5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (30% as unchanged drug)",
"    </p>",
"   </div>",
